  \"Continued Optimization of Low-Density Foam-Reinforced Ablatives for High-Velocity,
  High Heat Flux Earth Return Missions Project\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  2,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T22:18:52.641457\",\n\t\"name\": \"continued-optimization-of-low-density-foam-reinforced-ablatives-for-high-velocity-high-hea\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"In previous work for NASA, Ultramet and
  ARA Ablatives Laboratory developed and demonstrated advanced foam-reinforced carbon/phenolic
  ablators that offer substantially increased performance under high heat flux conditions
  and reduced weight relative to conventional ablators. The two-piece structure consisted
  of an ablative-filled foam front surface backed by Ultramet's previously established
  and highly insulating aerogel-filled foam. Arcjet testing was performed at NASA
  Ames Research Center to heat flux levels exceeding 1000 W/cm2, with the results
  showing a significantly reduced ablation rate compared to conventional chopped fiber
  ablators, and ablation behavior comparable to FM5055 at just one-third the density.
  It is apparent that the foam helps retain the char layer by physical reinforcement
  and/or that the network of interconnected passages allows pyrolysis gases to escape
  with less disruption of the char layer. In this project, Ultramet will team with
  ARA Ablatives for ablative infiltration of Ultramet foams and Materials Research
  and Design for ablation analysis, to continue optimization of foam-reinforced ablatives
  by focusing on two primary areas. The ablator formulation infiltrated into the foam
  will be modified to maximize heat flux capability consistent with NASA Earth return
  requirements (1500-2500 W/cm2), and a single-piece foam TPS structure will be developed
  rather than separate ablative- and aerogel-filled foam sections. Preliminary mechanical
  and thermal testing will be performed to support design and analysis and, depending
  on availability, initial ablation tests may be conducted at the Sandia Solar Tower
  Facility. High heat flux testing at the Air Force LHMEL facility or alternative
  would be performed in Phase II.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
